import React, { Component } from "react";

class News_Block extends Component {
  render() {
    return (
      
      <div className="col-lg-4 col-sm-6 mb-4">
        <div className="card h-100">
          <a href="#">
            <img
              className="card-img-top"
              src={this.props.block_img_src}
              alt=""
            />
          </a>
          <div className="card-body">
            <h4 className="card-title">
              <a href="#">{this.props.block_title}</a>
            </h4>
            <p className="card-text">
             {this.props.block_small_content}
            </p>
            <div className="button_group">
                <a href="#" className="btn btn-success btnLeft">
                  <i className="fa fa-eye"></i> Quick view
                </a>
                <a href={this.props.block_NavlinkFull} className="btn btn-primary btnRight">
                  <i className="fa fa-newspaper-o"></i> Full view
                </a>
              </div>
          </div>
        </div>
      </div>
    );
  }
}

export default News_Block;
